import {React, useState, useEffect} from 'react';
import './MediaList.css';

export default function MediaList(props){

    const medias = [
        {title:'FACEBOOK'},
        {title:'TWITTER'},
        {title:'INSTAGRAM'},
        {title:'LINKEDIN'},
      ]

      const mediaList = medias.map(media=>{
        return (
          <div className='social-item'>
                  <p>{media.title}</p>
          </div>
        )
      });

    return(
     <div className = 'social-media-container'>
        {mediaList}
      </div>
    )

}
